  `MAX_LEVEL` int(11) DEFAULT NULL,
  `MIN_LEVEL` int(11) DEFAULT NULL,
  `RE_LEVEL` int(11) DEFAULT NULL,
  `QTY_ORDER` int(11) DEFAULT NULL,
  `LAST_ISSUE` datetime DEFAULT NULL,
